import React from 'react'
import '../style.css';
import './Carousel.css';
import Carousel from './Carousel';
import ReactDOM from "react-dom";



function AppCarousel() {

  ReactDOM.render(
    <Carousel
      carouselItems={[
        <div>slide 1</div>,
        <div>slide 2</div>,
        <div>slide 3</div>
      ]}
    />,
    document.getElementById('shots')
  );
}

export default AppCarousel;
